import React from 'react';
import Playlist from "./Playlist";
import Controls from "./Controls";

const Music = () => {
    return (<div className = "pageArea">
        <div className="main">
            <div className="top">
                <Playlist />
            </div>
            <Controls />
        </div>
    </div>);
}

export default Music;
